#include "MySplashScreen.h"

//==============================================================================
MySplashScreen::MySplashScreen ()
    : backgroundImage (0)
{
    addAndMakeVisible (backgroundImage = new ImageButton (T("backgroundImage")));
    backgroundImage->setButtonText (String::empty);

    backgroundImage->setImages (false, true, false,
                                ImageCache::getFromMemory (virage_splashScreen_png, virage_splashScreen_pngSize), 1.0000f, Colour (0x0),
                                0, 1.0000f, Colour (0x0),
                                0, 1.0000f, Colour (0x0));
    setSize (640, 480);
}

MySplashScreen::~MySplashScreen()
{
  if (backgroundImage) {
    deleteAndZero (backgroundImage);
  }
}

//==============================================================================
void MySplashScreen::paint (Graphics& g)
{
    g.fillAll (Colours::white);
}

void MySplashScreen::resized()
{
    backgroundImage->setBounds (0, 0, proportionOfWidth (1.0000f), proportionOfHeight (1.0000f));
}


